mport time\nfrom dask_interface import Initialization\nfrom  dask_interface import CoupleDask\nimport numpy as np\nimport pandas as pd\nimport yaml\nimport dask.array as da\nfrom dask.distributed import performance_report\nfrom dask_ml.decomposition import IncrementalPCA\n\n\nwith open(r'config.yml') as file:\n    data = yaml.load(file, Loader=yaml.FullLoader)\n    Ssize = data[\"parallelism\"][\"height\"]*data[\"parallelism\"][\"width\"]\n    generations = data[\"MaxtimeSteps\"]\n    Sworkers = data[\"workers\"]\n    timeStep = 1\nC = Initialization(Ssize, Sworkers)\nC.client.get_versions(check=True)\n\n\n# Results \nResults = []\n\n# perf holds different time measurements \n# generation, getdata, get-from-queues, computation \nperf = np.empty([generations//timeStep, 4])\nt = time.perf_counter()\n\n\nwith performance_report(filename=\"dask-report.html\"):\n    for g in range(0, generations, timeStep):\n        tic3 = time.perf_counter()\n        tic = time.perf_counter()\n        arrays, perf[g//timeStep][2] = C.get_data()\n        arrays = da.reshape(arrays, (arrays.shape[1],arrays.shape[2])) \n        toc = time.perf_counter()\n        perf[g//timeStep][1] = toc - tic\n        tic1 = time.perf_counter()\n        if g==0:\n            pca=IncrementalPCA(n_components=2,copy=False, svd_solver='randomized')\n            pca.fit(arrays)\n        else:\n           pca.partial_fit(arrays)\n\n        arrays=None\n        toc1 = time.perf_counter()\n        perf[g//timeStep][3] = toc1 - tic1  \n        toc3 = time.perf_counter()\n        perf[g//timeStep][0] = toc3 - tic3\n\n\n\nprint(\"pca, \", pca, flush=True)\nResults.append([pca.explained_variance_ , pca.singular_values_])\ntp = time.perf_counter()\nprint(\"Total time to Dask solution is \", tp-t)\n\npperf = pd.DataFrame(perf,columns=['generation', 'getdata', 'getdataq', 'computation'])\npdata = pd.DataFrame(Results,columns=[ 'his', 'bins'])\n\nwith open(\"perf.csv\", \"a\") as fperf:\n    pperf.to_csv(fperf, encoding='utf-8', index=False)\n    \nwith open(\"diag.csv\", \"a\") as fdiag:\n    pdata.to_csv(fdiag, encoding='utf-8', index=False)\n    \nC.Finalization()\n    \n\n\n        &lt;/pre&gt;\n        "},"id":"1401","type":"Div"},{"attributes":{"source":{"id":"1213"}},"id":"1341","type":"CDSView"},{"attributes":{},"id":"1500","type":"UnionRenderers"},{"attributes":{"line_alpha":0.2,"line_color":"red","x":{"field":"time"},"y":{"field":"read_bytes"}},"id":"1310","type":"Line"},{"attributes":{"child":{"id":"1039"},"title":"Scheduler Profile (administrative)"},"id":"1405","type":"Panel"},{"attributes":{"format":"0.0b"},"id":"1364","type":"NumeralTickFormatter"},{"attributes":{"label":{"value":"write"},"renderers":[{"id":"1340"}]},"id":"1363","type":"LegendItem"},{"attributes":{},"id":"1501","type":"Selection"},{"attributes":{"mantissas":[1,2,5],"max_interval":500.0,"num_minor_ticks":0},"id":"1322","type":"AdaptiveTicker"},{"attributes":{"child":{"id":"bk-task-stream-plot"},"title":"Task Stream"},"id":"1406","type":"Panel"},{"attributes":{},"id":"1189","type":"LinearScale"},{"attributes":{"line_color":"red","x":{"field":"time"},"y":{"field":"read_bytes"}},"id":"1308","type":"Line"},{"attributes":{"child":{"id":"bk-bandwidth-worker-plot"},"title":"Bandwidth (Workers)"},"id":"1407","type":"Panel"},{"attributes":{},"id":"1454","type":"CategoricalTickFormatter"},{"attributes":{},"id":"1318","type":"DatetimeTickFormatter"},{"attributes":{"coordinates":null,"formatter":{"id":"1454"},"group":null,"major_label_policy":{"id":"1455"},"ticker":{"id":"1198"}},"id":"1197","type":"CategoricalAxis"},{"attributes":{},"id":"1234","type":"ResetTool"},{"attributes":{},"id":"1320","type":"UnionRenderers"},{"attributes":{"range_padding":0},"id":"1112","type":"DataRange1d"},{"attributes":{},"id":"1455","type":"AllLabels"},{"attributes":{"line_alpha":0.2,"line_color":"#1f77b4","x":{"field":"time"},"y":{"field":"cpu"}},"id":"1244","type":"Line"},{"attributes":{"factors":["numpy.ndarray"]},"id":"1187","t
